  return (
    <div className="text-3xl font-bold underline">
      hellloo everyone i am ayu h{props.kk}
      <h1 className='text-red-800 mx-3'>ddfjkhfghoiiht</h1>
      <section className='mx'></section>
    </div>
  )
}
Nav.defaultProps = {
  kk : "rammayanan"
}
